import React from 'react';
import '../CSS/End.css'; // Đảm bảo bạn có tệp CSS cho End.js
import { useNavigate } from 'react-router-dom';

const End = ({ score, attempts, timeTaken, onClose }) => {
  const navigate = useNavigate();

  const handleClose = () => {
    onClose();
    navigate('/home'); // Điều hướng về trang chính hoặc trang khác
  };

  return (
    <div className="modal show" onClick={handleClose}>
      <div className="modal-content" onClick={(e) => e.stopPropagation()}>
        <h2>Kết Thúc Trò Chơi</h2>
        <p>{`Điểm số của bạn: ${score}`}</p>
        <p>{`Số lượt chơi: ${attempts}`}</p>
        <p>{`Thời gian hoàn thành: ${timeTaken} giây`}</p>
        <div className="button-group">
          <button className="handleClose" onClick={handleClose}>Quay về</button>
        </div>
      </div>
    </div>
  );
};

export default End;
